import React from 'react';
import { Row, Col, Container } from "react-bootstrap";
import {Button} from 'react-bootstrap';
import NavBar from '../components/NavBar';



const Lending = (() =>{

    return (
<main>
<div className="wrapper">
<div className='bg'> 
  <NavBar />

    <Row className="mt-2">
    <Col lg={12} sm={12} xs={12} md={12}>
  


  
  <div className='textone'> Салон керамической плитки </div>
  <div className='texttwo'> Место, где всё чётко </div>

  
 

     

   
   </Col> 
   </Row>
   
   
   <div className='cont'>
<Row className="mt-2">
<Col lg={12} sm={12} xs={12} md={12}>

</Col>
</Row>
</div>

   
   </div>

</div>
</main>

);
});

export default Lending;
